import React from "react";

export const Auth = () => {
  return (
    <div style={{ display: "flex", flexDirection: "column" }}>
      <input type="email" name="" id="" placeholder="Email" />
      <input type="password" name="" id="" placeholder="Password" />
      <button>Go</button>
    </div>
  );
};
